import React, { useState } from 'react';
import './BuyStocks.scss'; // Import SCSS file for styling

const BuyStocks = () => {
  const [symbol, setSymbol] = useState('');
  const [quantity, setQuantity] = useState(0);

  const handleBuy = () => {
    // Handle buy logic here, e.g., send a request to the backend
  };

  return (
    <div className="buy-stocks-container">
      <h2>Buy Stocks</h2>
      <input type="text" value={symbol} onChange={(e) => setSymbol(e.target.value)} placeholder="Stock Symbol" />
      <input type="number" value={quantity} onChange={(e) => setQuantity(e.target.value)} placeholder="Quantity" />
      <button onClick={handleBuy}>Buy</button>
    </div>
  );
};

export default BuyStocks;
